          <button
            onClick={() => onNavigate('upload')}
            style={{
              backgroundColor: currentPage === 'upload' ? 'rgba(255,255,255,0.2)' : 'transparent',
              color: 'white',
              border: 'none',
              padding: '15px 20px',
              cursor: 'pointer',
              fontSize: '16px',
              fontWeight: currentPage === 'upload' ? 'bold' : 'normal',
              borderRadius: '4px 0 0 4px',
              transition: 'background-color 0.2s',
              borderBottom: currentPage === 'upload' ? '3px solid white' : '3px solid transparent'
            }}
            onMouseEnter={(e) => {
              if (currentPage !== 'upload') {
                e.currentTarget.style.backgroundColor = 'rgba(255,255,255,0.1)';
              }
            }}
            onMouseLeave={(e) => {
              if (currentPage !== 'upload') {
                e.currentTarget.style.backgroundColor = 'transparent';
              }
            }}
          >
            üì§ „Ç¢„ÉÉ„Éó„É≠„Éº„Éâ
          </button>
          <button
            onClick={() => onNavigate('search')}
            style={{
              backgroundColor: currentPage === 'search' ? 'rgba(255,255,255,0.2)' : 'transparent',
              color: 'white',
              border: 'none',
              padding: '15px 20px',
              cursor: 'pointer',
              fontSize: '16px',
              fontWeight: currentPage === 'search' ? 'bold' : 'normal',
              borderRadius: '0',
              transition: 'background-color 0.2s',
              borderBottom: currentPage === 'search' ? '3px solid white' : '3px solid transparent'
            }}
            onMouseEnter={(e) => {
              if (currentPage !== 'search') {
                e.currentTarget.style.backgroundColor = 'rgba(255,255,255,0.1)';
              }
            }}
            onMouseLeave={(e) => {
              if (currentPage !== 'search') {
                e.currentTarget.style.backgroundColor = 'transparent';
              }
            }}
          >
            üîç Ê§úÁ¥¢
          </button>
          <button
            onClick={() => onNavigate('generate')}
            style={{
              backgroundColor: currentPage === 'generate' ? 'rgba(255,255,255,0.2)' : 'transparent',
              color: 'white',
              border: 'none',
              padding: '15px 20px',
              cursor: 'pointer',
              fontSize: '16px',
              fontWeight: currentPage === 'generate' ? 'bold' : 'normal',
              borderRadius: '0 4px 4px 0',
              transition: 'background-color 0.2s',
              borderBottom: currentPage === 'generate' ? '3px solid white' : '3px solid transparent'
            }}
            onMouseEnter={(e) => {
              if (currentPage !== 'generate') {
                e.currentTarget.style.backgroundColor = 'rgba(255,255,255,0.1)';
              }
            }}
            onMouseLeave={(e) => {
              if (currentPage !== 'generate') {
                e.currentTarget.style.backgroundColor = 'transparent';
              }
            }}
          >
            ü§ñ Ë≥áÊñôÁîüÊàê
          </button>
        </nav>

        {/* „Éâ„Ç≠„É•„É°„É≥„ÉàÊï∞Ë°®Á§∫ */}
        <div style={{
          backgroundColor: 'rgba(255,255,255,0.2)',
          padding: '10px 15px',
          borderRadius: '20px',
          fontSize: '14px',
          fontWeight: 'bold'
        }}>
          üìÑ {documentCount}‰ª∂
        </div>
      </div>
    </header>
  );
};

export default Header;
